name: Cap'N Crunch Chicken
servings: 4
prep_time: 20 minutes
cook_time: 10 minutes
categories: [main-dishes, chicken]
ingredients: |
  12 whole Chicken Tenders (strips)
  1 cup All-purpose Flour
  2 whole Eggs, Beaten
  Salt And Pepper
  2 cups Cap'n Crunch Cereal
  Vegetable Oil, For Frying
  Ketchup, For Serving
directions: |
  Put the flour in a shallow bowl and add some salt and pepper. 
  Put the egg in a second shallow bowl. 
  Crush the cereal in a third bowl, leaving a few larger chunks.
  Dip the chicken strips first in the flour, then the egg and then the cereal.
  Heat 1/4 inch of oil in a large skillet over medium heat.
  Cook the strips in batches until golden brown and cooked through, 5 to 7 minutes, turning them so they don't burn. 
  Drain on paper towels and sprinkle with extra salt. 
  Serve with ketchup!
